//           {/* <button>{props.btnText}</button> */}
//       </div>
//     </div>
//   );
// }

function Services(props) {
  return (
      <div classNameName="row">
        <div classNameName="col-4">
          <div classNameName="list-group" id="list-tab" role="tablist">
            <a classNameName="list-group-item list-group-item-action active" id={`list-${props.title}-list`} data-toggle="list" href={`#list-${props.title}`} role="tab" aria-controls={`${props.title}`}>{props.title}</a>
          </div>
        </div>
        <div classNameName="col-8">
          <div classNameName="tab-content" id="nav-tabContent">
            <div classNameName="tab-pane fade show active" id={`list-${props.title}`} role="tabpanel" aria-labelledby={`list-${props.title}-list`}>{props.description}</div>
          </div>
        </div>
      </div>
  );
}

function Home() {
  return (
    <div>
    {/* <div>
      <h1>Pro Ride Coaching</h1>
      <img classNameNameNameName="bike" src="https://cdn.shopify.com/s/files/1/1772/1703/t/16/assets/cowboy-3-absolute-black-mudguards_1200x.png?v=2856224820422431643" alt="bike" />
    </div> */}
      <div className="services-container">
          {servicesData.map((service, key) => (
          <Services key={key} img={service.img} title={service.title} description={service.description} btnText={service.btnText} />
          ))}
      </div>   

      <div className="row">
        <div className="col-4">
          <div className="list-group" id="list-tab" role="tablist">
            <a className="list-group-item list-group-item-action active" id="list-home-list" data-toggle="list" href="#list-home" role="tab" aria-controls="home">Home</a>
            <a classNameName="list-group-item list-group-item-action active" id={`list-${props.title}-list`} data-toggle="list" href={`#list-${props.title}`} role="tab" aria-controls={`${props.title}`}>{props.title}</a>
          </div>
        </div>
        <div className="col-8">
          <div className="tab-content" id="nav-tabContent">
            <div className="tab-pane fade show active" id="list-home" role="tabpanel" aria-labelledby="list-home-list">...</div>
            <div className="tab-pane fade" id="list-profile" role="tabpanel" aria-labelledby="list-profile-list">...</div>
            <div className="tab-pane fade" id="list-messages" role="tabpanel" aria-labelledby="list-messages-list">...</div>
            <div className="tab-pane fade" id="list-settings" role="tabpanel" aria-labelledby="list-settings-list">...</div>
          </div>
        </div>
      </div>  

    </div>
  );
}

export default Home;
